import React from 'react';
import './App.css';
import Footer from './components/Footer';
import Header from './components/Header';

const App = () => {
  return (
    <>
     <Header />
     <main>
        <h1>Welcome to Style On</h1>
     </main>
     <Footer />
    </>
  );
}

export default App;
